      SELECT COUNT ( DISTINCT + CAST ( NULL AS INTEGER ) ) + 93 AS col2 FROM tab0 GROUP BY col0 HAVING NOT ( COUNT ( * ) ) = 94 / COUNT ( * );
  - name: tab0

outputs:
